class HeroModel {
	RightArm=false;
	LeftArm=false;
	Nose=0;
	X=0;
	Y=0;
	constructor(Id,X,Y,AttackPlayer){
		this.Id = Id;
		this.X=X;
		this.Y=Y;
		this.AttackPlayer=AttackPlayer;
		this.Time =0;
	};
	
}
export { HeroModel }
